import React from 'react'
import Header from '../../components/comman/Header'

import QuickInfo from '../../components/admin/QuickInfo';
import MainInfo from '../../components/admin/MainInfo';

const Deshboard_AD = () => {
  return (
    <div>
        <Header></Header>
        <div className='w-full flex  '>

            <div className='w-full p-4'>
                <QuickInfo></QuickInfo>
                <MainInfo></MainInfo>
            </div>

        </div>

     <div className='h-[2000px] bg-red-400 w-full border border-blue-600'></div>
    </div>
  )
}

export default Deshboard_AD;
